import React from 'react';
import { Link } from 'react-router-dom';

import './footer.css';

function Footer() {
    return (
        <div id='footer'>
            <ul id='footer-menu'>
                <li>
                    <Link to='/testsite'>Home</Link>
                </li>
                <li>
                <Link to='/testsite/activities'>Activities</Link>
                </li>
            </ul>
        </div>
    )
}
